define([
    'react/addons',
    'lodash'
], function (React, _) {
    'use strict';
    function scopeProfile1(pirate, pirateIndex) {
        var profile = pirate.profile;
        return React.createElement('div', { 'key': 'p-' + pirateIndex }, '\n        ', pirateIndex, '-', pirate.name, '-', profile.age, '\n    ');
    }
    function repeatPirate2(pirate, pirateIndex, profile) {
        return scopeProfile1.apply(this, [
            pirate,
            pirateIndex
        ]);
    }
    return function () {
        return React.createElement.apply(this, [
            'div',
            {},
            _.map([
                {
                    name: 'Jack Sparrow',
                    profile: { age: 99 }
                },
                {
                    name: 'Someone Else',
                    profile: { age: 98 }
                }
            ], repeatPirate2.bind(this))
        ]);
    };
});